def min_jumps(arr): 
    '''
    编写一个函数，找出从数组的第 1 个元素跳转到数组末尾的最少步数。对于给定的整数数组 "arr"，每个元素的值代表从该元素向前移动的最大步数。
    >>> min_jumps([1, 3, 6, 13, 17, 18])
    3
    '''    n = len(arr)
    if n <= 1:
        return 0
    if arr[0] == 0:
        return float('inf')
    max_reach = arr[0]
    steps = arr[0]
    jumps = 1
    for i in range(1, n):
        if i == n - 1:
            return jumps
        max_reach = max(max_reach, i + arr[i])
        steps -= 1
        if steps == 0:
            jumps += 1
            if i >= max_reach:
                return float('inf')
            steps = max_reach - i
    return float('inf')

